<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Double Value In Array</title>
</head>
<body>
    <script>
        a=[55,99,10,0,1,3,101,2,5,8,8,55]
        count=0
        for(i=0;i<a.length;i++){
            for(j=i+1;j<=a.length;j++){
                if(a[i] == a[j]){
                    count+=1
                    document.write(a[i]+"<br>")
                }
            }
        }
        document.write("Duplicate Value are ",count)
    </script>
</body>
</html>
